import React from 'react'
import { Link,Outlet } from 'react-router-dom'
export default function Menu() {
  return (
    <div>
      <Link to='/'>Menu</Link>
      <Link to='/projet'>projet</Link>
      <Link to='/projetslist'>projetslist</Link>
      <Link to='/projetmaj'>projetmaj</Link>
      <Outlet/>
    </div>
  )
}
